import "./App.css";
import InputDisplay from "./components/input-display";
import Button from "./components/button";
import Row from "./components/row";

function App() {
  const total = 0;
  const input = []; // input stack

  const inputClick = () => {
    console.log("click");
  };

  return (
    <div className="flex justify-center">
      <div className="w-[34rem] h-[41rem] border-double border-2 border-indigo-700 rounded px-2 py-2 [&>*]:py-1 bg-indigo-200">
        <InputDisplay total={total}></InputDisplay>
        <Row>
          <Button>C</Button>
          <Button>+-</Button>
          <Button>%</Button>
          <Button>/</Button>
        </Row>
        <Row>
          <Button>7</Button>
          <Button>8</Button>
          <Button>9</Button>
          <Button>X</Button>
        </Row>
        <Row>
          <Button>4</Button>
          <Button>5</Button>
          <Button>6</Button>
          <Button>-</Button>
        </Row>
        <Row>
          <Button>1</Button>
          <Button>2</Button>
          <Button>3</Button>
          <Button>+</Button>
        </Row>
        <Row>
          <Button>0</Button>
          <Button>.</Button>
          <Button halfWidth>=</Button>
        </Row>
      </div>
    </div>
  );
}

export default App;
